<script>
    import date from 'date-and-time'
    export default {
        data() {
            return {
                isSeasonData: true,
                time: Date.now()
            }
        },
        props: ['playerInfo', 'playerGameProfile', 'isFetching', 'lastFetched', 'myRank'],
        created() {
            const self = this
            this.dateInterval = setInterval(function () {
                self.time = Date.now()
                if(((self.time - self.lastFetched) / 1000) > 300) {
                    self.refetchData()
                }
            }, 1000)
        },
        computed: {
            sinceTime() {
                return this.timeSince(this.time, this.lastFetched)
            }
        },
        methods: {
            joinedAt(unixTime) {
                const now = new Date(unixTime)
                return date.format(now, 'MMM DD YYYY')
            },
            timeSince(now, time) {
                var seconds = Math.floor((now - time) / 1000)
                var interval = seconds / 31536000
                interval = seconds / 60
                if (interval > 1) {
                    return Math.floor(interval) + " minutes ago"
                }
                return Math.floor(seconds) + " seconds ago"
            },
            commafy( num ) {
                var str = num.toString().split('.');
                if (str[0].length >= 5) {
                    str[0] = str[0].replace(/(\d)(?=(\d{3})+$)/g, '$1,');
                }
                if (str[1] && str[1].length >= 5) {
                    str[1] = str[1].replace(/(\d{3})/g, '$1 ');
                }
                return str.join('.');
            },
            integerFormat(number) {
                if(number == NaN || number == undefined) return '-'
                return this.commafy(number.toFixed(0))
            },
            floatFormat(number) {
                if(number == NaN || number == undefined) return '-'
                return number.toFixed(2)
            },
            percentageFormat(number) {
                if(number == NaN || number == undefined) return '-'
                return number.toFixed(2) + '%'
            },
            hashFormat(number) {
                return '#' + this.toFixedNoRounding(number)
            },
            toFixedNoRounding(n) {
                return n.toString().match(/^-?\d+(?:\d{0})?/)[0]
            },
            inHours(number) {
                const hoursWmins = number / 60 / 60
                const hours = this.toFixedNoRounding(hoursWmins)
                let mins = (((hoursWmins - hours) * 60))
                mins = this.toFixedNoRounding(mins)
                return hours +'h,' + mins + 'm'
            },
            completed() {
            },
            playAnimation() {
                this.$refs.number2.play()
            },
            lifetimeData() {
                this.$emit('setSeasonData', false)
                this.isSeasonData = false
            },
            seasonData() {
                this.$emit('setSeasonData', true)
                this.isSeasonData = true
            },
            refetchData() {
                if(!this.isFetching) this.$emit('refresh')
                else console.log('can not do that')
            }
        }
    }
</script>
